import Link from 'next/link'
import auth0 from '../services/auth0'
import SideMenu from './sideMenu'

const Login = () => {
  return (
    <span className="nav-link" onClick={auth0.login}>SIGN IN</span>
  )
}

const LoginAddActivity = () => {
  return (
    <span className="nav-link" onClick={auth0.loginAddActivity}>ADD ACTIVITY</span>
  )
}

const Logout = () => {
  return (
    <span className="nav-link" onClick={auth0.logout}>LOGOUT</span>
  )
}

const AddActivity = () => {
  return (
    <Link href="/create">
      <span className="nav-link">ADD ACTIVITY</span>
    </Link>
  )
}

const MyActivities = () => {
  return (
    <Link href="/my-activities">
      <span className="nav-link">MY ACTIVITIES</span>
    </Link>
  )
}

const Nav = () => {

  return (
    <>
      <header className="main-header">



        <Link href="/">
        <a className="logo-group">
        <img src="/logo.svg" className="logo-img" alt="doo logo" />
        <h1 className="logo-type">discoverdoo</h1>
        </a>
      </Link>







      <div className="menu">
          { auth0.isAuthenticated() &&
          <>
          <div className="loggedin">
            <AddActivity />
            <MyActivities />
            <Logout />
          </div>
          <SideMenu />
          </>
          }
          { auth0.isAuthenticated() === false &&
          <>
            <LoginAddActivity />
            <Login />
          </>
          }
        </div>
      </header>
      <style jsx>{`

.main-header {
  display: flex;
  justify-content: space-between;
}

        #logo {
          width: 70px;
          margin-top:20px
        }

        .country {
          color: #ffffff;
          margin-top: 12px;
        }

        .tagline {
          margin-top: -16px;
          display: inline;
          font-family: sans-serif;
          color: #fff;
          font-size: 1.8rem;
          font-weight: 200;
          letter-spacing: 1px;
        }

        #menu {
          margin-left: auto;
          margin-top: 5px;
          margin-right: 13px;
        }

.menu {
  display: flex;
  justify-content: flex-end;
  width: 180px;
  margin-top: 20px;
}

.logo-group {
  display: flex;
  text-decoration: none;
  margin-top: 20px;
}

.logo-img {
  margin-top: 4px;
  width: 60px;
  height: 35px;
}

.logo-type {
  color: white;
  font-size: 1.4rem;
  font-weight: 500;
  margin-top: -6px;
}








      `}</style>
    </>
  )
}

export default Nav
